INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (197,'041','아득한 바다, 적적한 풍랑 위에 한 조각 배를 띄운 것입니다. 아무리 험하고 멀지라도 재물이 외방에 있으니 나가면 반드시 손에 들어오겠습니다. 몸이 길 가운데 있으니 어찌피 한번은 몰리 떠나야할 신수입니다. 만일 집안에 근심이 없으면 어차피 구설수가 생길지도 모릅니다. 몸이 멀고 먼 타황에서 놀고 있으니 이익을 얻더라도 별 소득이 되지 못하겠습니다. 글쓴이의 운수는 시비를 가까이 해서는 안됩니다. 가을비가 내리는 봄바람에 봄꽃은 피지 않고 초된 꽃만 말발하니 어쩌겠습니까. 시장거리에 나가서 사중 사녁을 하고자 하니 머리는커녕 꼬리도 보기 힘듭니다. 한 사람이 범을 갈고 농사를 지어서 열 사람이 나눠어 먹는 것이니 할 일은 많고 소득은 적겠습니다.','만약 부모형제의 환난을 겪지 않는다면 신중의 근심이 있을지도 모릅니다. 하고자 하는 일이 있어도 처음은 길하고 뒤는 흉합니다. 집을 나와서 어디로가 행하게 되겠습니다. 이익이 타황에 있음을 알았거든 어려움을 무릅쓰고 가는 것이 좋겠습니다.','길흉이 상반하니 한 번은 기쁘하고 한 번은 슬프하겠습니다. 몸이 범에 있어 이미 농사를 짓고 있는데 일 백가지 생각을 한들 무슨 소용이 있겠습니까. 하던 일을 열중함만 못하겠습니다. 스스로 가정을 이루고 지켜나가는 일에 전념하는 것이 좋습니다.','비록 재수는 있으나 거두하여 피해를 당할까 두렵습니다 몸이 길 위에 있으니 재물을 상실하거나 흐비하지 않을 수 없겠습니다. 이 달의 운수는 범은 흉하고 범은 길합니다. 피해를 입지 않으면 일이 바뀌서 노상을 뛰며 손실을 보게 될 것입니다.','손사에 염려가 있으며 동서남북으로 부질없히 떠돌아다닐 것입니다. 시비를 가까이 하게 되면 결국 관재수를 당하게 됩니다. 이 달의 운수는 구설수를 조심해야 합니다. 구설수에 말려 시비를 바이게 되면 마치 관재까지 불러들이게 됩니다.','만일 그대가 대인이라면 길할 것이고 만일 소인이라면 흉하겠습니다. 다행이 길할 운을 만나오니 모든 일을 가히 성취합니다. 재물을 구함에 마음대로 이룸되고 모든 일이 성취되겠으니 이보다 기쁜 일이 또 있겠습니까?','집에 있으면 불리하고 실행하면 길하니 하던 일보다는 새로운 일에 도전해 보는 것도 고려해 볼 만합니다. 5월과 6월에는 이익이 타황이나 다른 곳에 있습니다. 산도 선도 물도 선데 몸이 타황에서 놀는 것이지만 이익은 그곳에 있으니 유의하시기 바랍니다.','처음은 길하고 뒤에는 흉하니 수고로움이 있은 뒤에야 그 공을 얻게 됩니다. 모든 일을 가히 조심한다면 마치 길함이 도래하겠습니다. 심신을 정하기 어려우니 마음이 번거롭고 무로울 것이니 수고가 있고 나서야 성취함이 있겠으니 참고 견디는 것이 상책입니다.','새로운 일을 도모하면 불리하니 다른 경험을 섣불리 서두지 마십시오. 이 달의 운수는 직분을 지켜서 현상을 유지함이 상책입니다. 일이 흐지부되기 쉬우니 분수 밖의 것을 탐하게 된다면 감당하기 어려운 흐뭇함을 맛보게 되겠습니다. 다른 경험을 꾀하지 마십시오.','물고기와 용이 때를 이룬었으니 마치 활기를 놓치고 맙니다. 몸에는 장애가 친근할 수 있으니 미리 얼을 면하도록 주의하십시오. 이 달의 운수는 작은 재물은 가히 얻을 수 있으나 큰 것을 도모하면 새롭게 되겠습니다.','강을 건너고자 하는데 배가 없으니 어찌 뜻을 성취하겠습니까. 누가 무슨 말을 하더라도 믿지 마십시오. 이름은 있으나 실상이 없으니 때가 아닙니다. 이 달의 운수는 나아가려고 하지만 나아가지 못하는 것이니 잠시 머물거 다음 기회를 기다림이 옳겠습니다.','신수가 불리하니 후사를 조심하십시오. 다른 재물을 탐하게 되면 이익은 없고 도리어 해가 있을 것이니 주의하십시오. 분수를 지켜이 재물을 얻는 길이니 문을 닫고 들어삼아 밖을 탐하지 않는 것이 가장 좋은 방법입니다.','있는 힘을 다하여 일을 구하지만 머리는 있으나 꼬